import React from "react";
import { Line } from "react-chartjs-2";

const LineChart = () => {
  const data = {
    labels: ["", "", "", "", "", ""],
    datasets: [
      {
        data: [12, 19, 3, 5, 2, 3],
        backgroundColor:
          "linear-gradient(to right top, #051937, #004d7a, #008793, #00bf72, #a8eb12)",
        borderColor: "red",
        fill: true,
      },
    ],
  };

  const options = {
    plugins: {
      legend: {
        display: false,
      },
    },
    scales: {
      y: {
        display: false,
      },
      x: {
        display: false,
      },
    },
    radius: 0,
    tension: 0.4,
  };

  return (
    <>
      <Line data={data} options={options} />
    </>
  );
};

export default LineChart;
